import React from "react";
import * as THREE from 'three'
import {OBJViewer, STLViewer} from 'frontend/node_modules/react-stl-obj-viewer';




function Stl(props){
return(
	<STLViewer
	onSceneRendered={(element) => {
		console.log(element)
	}}
	sceneClassName="test-scene"
	file={props.stlFile}
	className="stl"
	modelColor="#FF0000"/> 
)

};

export default Stl;
